INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 1, "リリ", 1, 1, 2, 24001, 40011, 321, 125801);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 1, "クリア", 1, 2, 2, 24001, 40011, 322, 126001);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("んーと。\nこれ、あげる。\nはい", 0, 1, "プレシア", 1, 3, 2, 24001, 40011, 323, 126101);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 1, "リリ", 2, 4, 2, 24001, 40011, 324, 125801);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 1, "クリア", 2, 5, 2, 24001, 40011, 325, 126001);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("お兄。\nきてくれて、うれしい", 0, 1, "プレシア", 2, 6, 2, 24001, 40011, 326, 126101);
